const content = ({tweetdata}) =>{
  const style = {
    width:"42px",
    height: "42px",
    borderBottomLeftRadius:"20px",
    borderBottomRightRadius: "20px",
    borderTopLeftRadius: "20px",
    borderTopRightRadius: "20px"
} 

  return (
    <div  className="column middle">
      {
        tweetdata.map(item => (
          <div >
            <div><img src={item.image} style={style}/>        <b> {item.name} </b>   {item.tweetid}</div>
            <br/>
            <div>{item.content}</div> 
            <div>
              <p>
                <img src="/images/narendramodiimage.jpg" alt="Comments" style={style}/>
                <img src="/images/retweet.png" alt="Re Tweet" style={style}/>  
                <img src="/images/download.png" alt="like"style={style} /> 
                <img src="/images/download.png" alt="like"style={style} /> 

              </p>
            </div>           
          </div>
          ))
      }


    </div>
    )
}

export default content
